import axios from "axios";
import React from "react";
import { City } from "../Home/CityDTO";
// import {ReactComponent as Clock} from "./././images/clock.svg" ;
interface iProps {
  city: City;
  key: string;
}
function Detail(props: iProps) {
  console.log(props);
  return <div>

  </div>;
}
export default Detail;

function openDetailPage(latitude: number, longitude: number): void {
  axios
    .get(
      `https://api.openweathermap.org/data/2.5/onecall?lat=${latitude}&lon=${longitude}&exclude=hourly,minutely,alerts&appid=e899757c1162bf7b2b2684a0b2b8f5cc`
    )
    .then((response) => console.log(response))
    .catch((error) => console.log(error));
}
